(Translated by Google) This is not the first time I'm excited! The food is really good and I think it's great that you are offering the sushi menu again. The atmosphere is great too! I am a particular fan of the swings that you have newly installed as seating. Everything looks very urban and fashionable. I will definitely visit you again! (;

(Original)
Ich bin nicht das erste Mal begeistert! Das Essen ist wirklich gut und ich finde es toll, dass ihr die Sushikarte wieder anbietet. Die Atmosphäre ist auch super! Ein besonderer Fan bin ich von den Schaukeln die ihr als Sitzgelegenheit neu eingebaut habt. Wirkt alles sehr urban und modisch. Ich werde euch auf jeden Fall wieder besuchen! (;
